import React, { Component } from "react";

export default class Content extends Component {

  constructor(props) {
    super(props);

    this.state = {
      hahaha: 'hasdufhasduf'
    };
  }

	render(){
		return (
      <article className="component_content">
        <h2 tabIndex="0" className="h2">{this.props.blockTitle}</h2>

        <div>
          <div className="component_content__demo">
            {this.state.hahaha}
          </div>

          <div className="component_content__code">
            <pre>
              <code className="language-html">
              {`<button role="button" class="btn btn-primary btn--large">Button</button>
<button role="button" class="btn btn-primary btn--medium">Button</button>
<button role="button" class="btn btn-primary btn--small">Button</button>
<button role="button" class="btn btn-primary btn--small-extra">Button</button>`}
              </code>
            </pre>
          </div>
        </div>
      </article>
		)
	}
}
